import React from 'react';
import { Link } from 'react-router-dom';
import imageurl from './imageurl.jpg';
function Blog() {


  const imageUrl = 'https://localhost/?p=64'; // Replace with the URL you want to link to
  return (
    <div>
      <div>
      <header>
        <h1>MS in DS Academic Program</h1>
      </header>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/contactus">Contact Us</Link>
        <Link to="/services">Services</Link>
        <Link to="/login">Login</Link>
      </nav>
          </div>



  return (
    <div>
      <br></br><br></br>
      <center><h2>Blog Post</h2><br></br>
      <p>Blog Content is here ...Please Click on Image</p></center><br></br>
      <a href={imageUrl} target="_blank" rel="noopener noreferrer">
        <center><img src={imageurl} alt="Blog Post" className="centered-image" /></center>
      </a>
    </div>
  );
}

export default Blog;

    <footer>
    <p>&copy; Copyright MS in DS Academic Program</p>
  </footer>
  </div>
  );
}

export default Blog;
